import React, {useState} from 'react'

import styled from "styled-components";

const Container = styled.div`
    width:100%;
`


export default function LebenslaufItem(props) {
    const [expand] = useState(props.expand);

    return (
        <Container>
            {expand &&
                <p>expand</p>
            }
        </Container>
    )
}
